from typing import List

class Solution:
    def goto_next_zero(self, nums: List[int], index: int) -> int:
        new_index = index
        while new_index < len(nums) and nums[new_index] != 0:
            new_index += 1
        return new_index

    def flip_k(self, nums:List[int], index: int, k: int) -> int:
        new_index = index
        terminate = new_index + k
        if terminate > len(nums):
            return -1
        else:
            new_zero_start = 0
            while new_index < terminate:
                if (nums[new_index] == 0):
                    nums[new_index] = 1
                else:
                    nums[new_index] = 0
                    if new_zero_start == 0:
                        new_zero_start = new_index
                new_index += 1
            return new_zero_start

    def minKBitFlips(self, nums: List[int], k: int) -> int:
        index = 0
        flips: int = 0
        while index < len(nums):
            if nums[index] == 1:
                # go forward to the next 0
                index = self.goto_next_zero(nums, index)
            else:
                flips += 1
                prepare_index = self.flip_k(nums, index, k)
                if prepare_index == -1:
                    return -1
                elif prepare_index == 0:
                    index = self.goto_next_zero(nums, index + k)
                else:
                    index = prepare_index
        return flips

